import React from "react";
import { Row, Col, Accordion } from "react-bootstrap";

const creditsData = [
    {
        id: 11,
        name: "david",
        email: "david@email.com",
        total_amount: 703.32,
        credits_group_breakdown: [
            {
                amount: 100.0,
                group_id: 7,
                group_name: "second",
            },
            {
                amount: 603.32,
                group_id: 6,
                group_name: "another group ",
            },
        ],
    },
    {
        id: 10,
        name: "charlie",
        email: "charlie@email.com",
        total_amount: 286.36,
        credits_group_breakdown: [
            {
                amount: 286.36,
                group_id: 6,
                group_name: "another group ",
            },
        ],
    },
];

const debtsData = [
    {
        id: 1,
        name: "Jeus",
        email: "jeus@email.com",
        total_amount: 286.36,
        debts_group_breakdown: [
            {
                amount: 286.36,
                group_id: 6,
                group_name: "another group ",
            },
        ],
    },
    {
        id: 3,
        name: "tim",
        email: "tim@email.com",
        total_amount: 124.96,
        debts_group_breakdown: [
            {
                amount: 124.96,
                group_id: 6,
                group_name: "another group ",
            },
        ],
    },
];

const FriendsCreditDebit = () => {
    return (
        <Row>
            {/* Left Box - Users you owe */}
            <Col xs={6}>
                <h3>Users you owe</h3>
                {debtsData.map((user) => (
                    <Accordion key={user.id}>
                        <Accordion.Item eventKey={user.id}>
                            <Accordion.Header className="d-flex justify-content-between">
                                <div>{user.name}</div>
                                <div>Total Amount: {user.total_amount}</div>
                            </Accordion.Header>
                            <Accordion.Body>
                                {user.debts_group_breakdown.length > 4 ? (
                                    <div
                                        style={{
                                            maxHeight: "300px",
                                            overflowY: "auto",
                                        }}
                                    >
                                        {user.debts_group_breakdown.map(
                                            (debt, index) => (
                                                <div
                                                    key={index}
                                                    className="w-100 d-flex flex-row justify-content-between"
                                                >
                                                    <div>{debt.group_name}</div>
                                                    <div>
                                                        Amount: {debt.amount}
                                                    </div>
                                                </div>
                                            )
                                        )}
                                    </div>
                                ) : (
                                    user.debts_group_breakdown.map(
                                        (debt, index) => (
                                            <div
                                                key={index}
                                                className="d-flex justify-content-between"
                                            >
                                                <div>{debt.group_name}</div>
                                                <div>Amount: {debt.amount}</div>
                                            </div>
                                        )
                                    )
                                )}
                            </Accordion.Body>
                        </Accordion.Item>
                    </Accordion>
                ))}
            </Col>

            {/* Right Box - Users owe you */}
            <Col xs={6}>
                <h3>Users owe you</h3>
                {creditsData.map((user) => (
                    <Accordion key={user.id}>
                        <Accordion.Item eventKey={user.id}>
                            <Accordion.Header className="d-flex justify-content-between">
                                <div>{user.name}</div>
                                <div>Total Amount: {user.total_amount}</div>
                            </Accordion.Header>
                            <Accordion.Body>
                                {user.credits_group_breakdown.length > 4 ? (
                                    <div
                                        style={{
                                            maxHeight: "300px",
                                            overflowY: "auto",
                                        }}
                                    >
                                        {user.credits_group_breakdown.map(
                                            (credit, index) => (
                                                <div
                                                    key={index}
                                                    className="d-flex justify-content-between"
                                                >
                                                    <div>
                                                        {credit.group_name}
                                                    </div>
                                                    <div>
                                                        Amount: {credit.amount}
                                                    </div>
                                                </div>
                                            )
                                        )}
                                    </div>
                                ) : (
                                    user.credits_group_breakdown.map(
                                        (credit, index) => (
                                            <div
                                                key={index}
                                                className="d-flex justify-content-between"
                                            >
                                                <div>{credit.group_name}</div>
                                                <div>
                                                    Amount: {credit.amount}
                                                </div>
                                            </div>
                                        )
                                    )
                                )}
                            </Accordion.Body>
                        </Accordion.Item>
                    </Accordion>
                ))}
            </Col>
        </Row>
    );
};

export default FriendsCreditDebit;
